4),(3760,'service-path','services',-1234),(3761,'accountIdRecovery','WSO2 Carbon - Account Recovery|\n            Hi {{user.claim.givenname}},\n\n            We received a request to recover your account user name. The account associated with us indicates that the\n            user name is : {{userstore-domain}}/{{user-name}}@{{tenant-domain}}\n        |\n            Best Regards,\n            WSO2 Carbon Team\n            http://www.wso2.com\n        ',-1234),(3762,'passwordReset','WSO2 Carbon - Password Reset|\n            Hi {{user.claim.givenname}},\n\n            We received a request to change the password on the {{user-name}} account associated with this e-mail address.\n            If you made this request, please click the link below to securely change your password:\n\n            https://localhost:9443/accountrecoveryendpoint/confirmrecovery.do?confirmation={{confirmation-code}}&userstoredomain={{userstore-domain}}&username={{url:user-name}}&tenantdomain={{tenant-domain}}&callback={{callback}}\n\n            If clicking the link doesn\'t seem to work, you can copy and paste the link into your browser\'s address\n            window.\n\n            If you did not request to have your {{user-name}} password reset, simply disregard this email and no changes\n            to your account will be made.\n        |\n            Best Regards,\n            WSO2 Carbon Team\n            http://www.wso2.com\n        ',-1234),(3763,'temporaryPassword','WSO2 Carbon - Temporary Password|\n            Hi {{user.claim.givenname}},\n\n            Please find your temporary password below.\n\n            User Name: {{user-name}}\n            Temporary Password: {{temporary-password}}\n        |\n            Best Regards,\n            WSO2 Identity Server Team\n            http://www.wso2.com\n        ',-1234),(3764,'adminforcedpasswordresetwithotp','WSO2 - Admin Forced Password Reset|\n            Hi {{user.claim.givenname}},\n\n            We received a request to change the password on the {{user-name}} account associated with this e-mail address.Please use below OTP as the password at next login and then reset your password.\n\n            OTP : {{confirmation-code}}\n\n        |\n            Best Regards,\n            WSO2 Carbon Team\n            http://www.wso2.com\n        ',-1234),(3765,'initiateRecovery','WSO2 Carbon - You started to reset password|\n            Hi {{user.claim.givenname}},\n\n            This is to notify that you have initiate to reset your password using security questions.\n        |\n            Best Regards,\n            WSO2 Identity Server Team\n            http://www.wso2.com\n        ',-1234),(3766,'emailConfirm','WSO2 Carbon - Email Confirmation|\n            Hi {{user.claim.givenname}},\n\n            You have created an account with following user name\n\n            User Name: {{user-name}}\n\n            Please click the following link to unlock. If clicking the link doesn\'t seem to work, you can copy and paste\n            the\n            link into your browser\'s address window.\n\n            https://localhost:9443/accountrecoveryendpoint/confirmregistration.do?confirmation={{confirmation-code}}&userstoredomain={{userstore-domain}}&username={{url:user-name}}&tenantdomain={{tenant-domain}}\n        |\n            Best Regards,\n            WSO2 Identity Server Team\n            http://www.wso2.com\n        ',-1234),(3767,'accountDisable','WSO2 Carbon - Your account disabled|\n            Hi {{user.claim.givenname}},\n\n            Please note that the account registered with us with the user name : {{user-name}} has been disabled.\n        |\n            Best Regards,\n            WSO2 Identity Server Team\n            http://www.wso2.com\n        ',-1234),(3768,'accountConfirmation','WSO2 Carbon - Account Confirmation|\n            Hi {{user.claim.givenname}},\n\n            You have created an account with following user name\n\n            User Name: {{user-name}}\n\n            Please click the following link to unlock. If clicking the link doesn\'t seem to work, you can copy and paste\n            the\n            link into your browser\'s address window.\n\n            https://localhost:9443/accountrecoveryendpoint/confirmregistration.do?confirmation={{confirmation-code}}&userstoredomain={{userstore-domain}}&username={{url:user-name}}&tenantdomain={{tenant-domain}}&callback={{callback}}\n        |\n            Best Regards,\n            WSO2 Identity Server Team\n            http://www.wso2.com\n        ',-1234),(3769,'passwordResetSucess','WSO2 Carbon - Your Password Reset successfully|\n            Hi {{user.claim.givenname}},\n\n            Please note that your password reset operation is successfully completed.\n        |\n            Best Regards,\n            WSO2 Identity Server Team\n            http://www.wso2.com\n        ',-1234),(3770,'accountLock','WSO2 Carbon - Your account Locked|\n            Hi {{user.claim.givenname}},\n\n            Please note that the account registered with us with the user name : {{user-name}} has been locked.\n        |\n            Best Regards,\n            WSO2 Identity Server Team\n            http://www.wso2.com\n        ',-1234),(3771,'idleAccountReminder','WSO2 Carbon - Your account is inactive|\n            Hi {{user.claim.givenname}},\n\n            It looks as though you haven\'t signed in to your account for quite a while. Please sign in to your account if you\'d like to keep your account active.\n        |\n            Best Regards,\n            WSO2 Identity Server Team\n            http://www.wso2.com\n        ',-1234),(3772,'accountEnable','WSO2 Carbon - Your account enabled|\n            Hi {{user.claim.givenname}},\n\n            Please note that the account registered with us with the user name : {{user-name}} has been enabled.\n        |\n            Best Regards,\n            WSO2 Identity Server Team\n            http://www.wso2.com\n        ',-1234),(3773,'askPassword','WSO2 Carbon -